import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  //Link,
  //useRouteMatch,
 // useParams,
} from "react-router-dom";
import HomePage from "./HomePage";
import loggingPage from "./loggingPage";

class AppСontent extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/">
            <HomePage />
          </Route>
          <Route path="/login">
            <loggingPage />
          </Route>
          <Route path="/news">
            <div>
              <h1>страница с новостями</h1>
            </div>
          </Route>
          <Route path="/profile">
            <div>
              <h1>
                Страница с произвольным текстом, недоступная без авторизации
              </h1>
            </div>
          </Route>
        </Switch>
      </Router>
    );
  }
}
export default AppСontent;
